import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const IndexContainer = styled.div`
    .contentContainer{
        width:100%;
        height: auto;
        color:#333333;

        .contentWrap{
            max-width:1200px;
            height:auto;
            margin:120px auto 100px;

            .contentItemWrap{
                width:1000px;
                margin:0 auto;

                .item{
                    width:100%;
                    height: 200px;
                    border:1px solid #D9D9D9;
                    border-radius: 10px;
                    display: flex;
                    align-items: center;

                    .itemLink{
                        display: flex;

                        .imgWrap{
                        height: 100%;
                        width:40%;
                        background-image: url('/img/minSup/m01.jpg');
                        position: relative;

                        span{
                            position: absolute;
                            bottom:10px;
                            left:10px;
                            font-size:14px;
                            color:#B3B3B3;
                        }
                    }

                    .textWrap{
                        width:60%;
                        height: 100%;
                        padding:35px 50px;
                        background-color: #f9f9f9;
                        display: flex;
                        align-items: center;

                        .textInner{

                            .itemTit{
                                font-size:24px;
                                font-weight:700;
                                margin-bottom:10px;
                            }

                            .itemTxt{
                                font-size:16px;
                                color: #959595;
                                margin-bottom:15px;
                                line-height: 1.3;
                            }

                            .link{
                                width:140px;
                                height: 36px;
                                border-radius: 20px;
                                background-color: #34964B;
                                color:#ffffff;
                                display: flex;
                                align-items: center;
                                justify-content: center;
                                font-size:14px;
                            }
                        }
                    }
                    }

                    
                }
            }
        }
    }
`;

const index = memo(() => {
    return (
        <IndexContainer>
            <Title title='마음지원' txt='취업에 대한 불안감을 날릴 수 있도록 최선의 노력을 하겠습니다.' />
            <div className='contentContainer'>
                <div className='contentWrap'>
                    <ul className='contentItemWrap'>
                        <li className='item'>
                            <a href='#' className='itemLink'>
                                <div className='imgWrap'>
                                    <span>※클릭 시 외부 사이트로 연결됩니다.</span>
                                </div>
                                <div className='textWrap'>
                                    <div className='textInner'>
                                        <h2 className='itemTit'>마인드 힐링 심리상담센터</h2>
                                        <p className='itemTxt'>
                                            취업에 대한 불안감으로 하루하루를 준비하고 계신가요?
                                            스펙이 아닌 마인드컨트롤의 중요성을 인지하며 마인드 힐링이 함께합니다.
                                        </p>
                                        <a href='#' className='link'>사이트 바로가기</a>
                                    </div>
                                </div>
                            </a>
                        </li>
                    </ul>
                </div>
            </div>
        </IndexContainer>
    );
});

export default index;
